I have a list of items that I want to sort by name. The problem is that the names are case sensitive. For example, I have two items: "apple" and "Apple". I want to sort them so that "apple" comes before "Apple". I have tried using the following code:
var items = ["apple", "Apple", "banana", "Banana"];
items.sort(function(a, b) {
    return a.localeCompare(b);
console.log(items);
But the result is:
["Apple", "apple", "Banana", "banana"]
How can I sort the items so that "apple" comes before "Apple"?
marked as duplicate by Bergi  javascript Sep 21 '16 at 15:01
You can use the localeCompare method with the second argument set to true :
items.sort(function(a, b) {
    return a.localeCompare(b, undefined, {sensitivity: 'base'});
console.log(items);
The second argument is the locale to use for the comparison. The third argument is an object with options for the comparison. The sensitivity option is the one you need.
The default value for the sensitivity option is "accent" , which means that the comparison is case sensitive. Setting it to "base" makes the comparison case insensitive.
See the MDN documentation for the localeCompare method for more information.
